import { Link } from 'react-router-dom'

import Container from './Container'
import styles from './Navbar.module.css'

function Navbar(){
    return(
        <div>
        <Link to="/">Home</Link>
        <Link to="/informacoes">Informacoes</Link>
        <Link to="/contato">Contato</Link>
        </div>
    )
}

export default Navbar
